pub fn get_flink_root_grammar_id() -> GrammarId {
    GrammarId(1362)
}
pub fn get_flink_root_grammar_table() -> RootGrammar {
    RootGrammar::TableDriven {
        grammar_id: get_flink_root_grammar_id(),
        tables: &FLINK_TABLES,
    }
}
pub fn get_flink_root_grammar() -> RootGrammar {
    get_flink_root_grammar_table()
}
